import React from 'react';
import ReactDOM from 'react-dom';
import { Switch, Route } from 'react-router-dom'

import Home from './Home';
import About from './About';
import Blog from './Blog';
import Contact from './Contact';
import Login from './Login';
import Signup from './Signup';

const routing=()=>(

    <main>

      <Switch>
          <Route exact path='/' component={Home}/>
          <Route path='/page/view' component={About}/>
          <Route path='/blog/index' component={Blog}/>
          <Route path='/site/contact' component={Contact}/>
          <Route path='/user/sign-in/signup' component={Signup}/>
          <Route path='/user/sign-in/login' component={Login}/>
</Switch>
</main>

  )

  export default routing;
